INSERT INTO `events_confirmation_verification_codes` (`shortname`, `type`, `code`, `description`) VALUES
('Event', 'Event', '0', 'Regular Event - no confirmation, no verification'),
('Single', 'Confirmation', '1', 'User Confirmation - Single user confirmation (ie - the current user needs to confirm this event in order for it to be complete'),
('Double', 'Confirmation', '2', 'The current event SENDS a confirmation request to a SECOND user (user-2) AND a message to user-1 this event needs a confirmation (verification) to be completed.'),
('Triple', 'Confirmation', '3', 'Similar to Two User Confirmation\nTHIS EVENT code means that the current event SENT a confirmation request to a Third user (user-3) AND a message to user-1 and user-2 that this event needs a confirmation (verification) to be completed.\n'),
('verify-1', 'Verification', '4', 'User 1 - Confirmed themselves'),
('verify-2', 'Verification', '5', 'User 2 - verified (returned the confirmation.'),
('verify-3', 'Verification', '6', 'User 3 - returned confirmation'),
('timeout-1', 'Timeout', '7', 'User 1 - Timeout - did not return the confirmation'),
('timeout-2', 'Timeout', '8', 'User 2 - Timeout - did not return the confirmation'),
('timeout-3', 'Timeout', '9', 'User 3 - Timeout - did not return the confirmation');
