(99, 17, 7, 'Jelly', '<h3>Common jellyfish description</h3>\r\n\r\n<div>\r\n<table class=\"factfileTaxonomy\" style=\"border-collapse:collapse; border-spacing:0px; border:0px; box-sizing:border-box; float:right; font-family:inherit; font-style:inherit; font-variant:inherit; font-weight:inherit; line-height:inherit; margin:0px 0px 1.25em 1.25em; padding:0px; vertical-align:baseline\">\r\n  <tbody>\r\n    <tr>\r\n      <td style=\"vertical-align:middle\">Kingdom</td>\r\n      <td style=\"vertical-align:middle\"><a href=\"http://www.arkive.org/explore/species?taxonomy=animalia\">Animalia</a></td>\r\n    </tr>\r\n    <tr>\r\n      <td style=\"vertical-align:middle\">Phylum</td>\r\n      <td style=\"vertical-align:middle\"><a href=\"http://www.arkive.org/explore/species?taxonomy=animalia_cnidaria\">Cnidaria</a></td>\r\n    </tr>\r\n    <tr>\r\n      <td style=\"vertical-align:middle\">Class</td>\r\n      <td style=\"vertical-align:middle\"><a href=\"http://www.arkive.org/explore/species?taxonomy=animalia_cnidaria_scyphozoa\">Scyphozoa</a></td>\r\n    </tr>\r\n    <tr>\r\n      <td style=\"vertical-align:middle\">Order</td>\r\n      <td style=\"vertical-align:middle\"><a href=\"http://www.arkive.org/explore/species?taxonomy=animalia_cnidaria_scyphozoa_semaeostomeae\">Semaeostomeae</a></td>\r\n    </tr>\r\n    <tr>\r\n      <td style=\"vertical-align:middle\">Family</td>\r\n      <td style=\"vertical-align:middle\"><a href=\"http://www.arkive.org/explore/species?taxonomy=animalia_cnidaria_scyphozoa_semaeostomeae_ulmaridae\">Ulmaridae</a></td>\r\n    </tr>\r\n    <tr>\r\n      <td style=\"vertical-align:middle\">Genus</td>\r\n      <td style=\"vertical-align:middle\"><a href=\"http://www.arkive.org/explore/species?taxonomy=animalia_cnidaria_scyphozoa_semaeostomeae_ulmaridae_aurelia\"><em>Aurelia</em></a>&nbsp;<span style=\"font-family:inherit; font-size:0.714em\"><a href=\"http://www.arkive.org/common-jellyfish/aurelia-aurita/#ref1\">(1)</a></span></td>\r\n    </tr>\r\n  </tbody>\r\n</table>\r\n\r\n<p>As its name suggests, the common jellyfish (<em>Aurelia aurita</em>) is the most common jellyfish species on British shores&nbsp;<span style=\"font-family:inherit; font-size:0.714em\"><a href=\"http://www.arkive.org/common-jellyfish/aurelia-aurita/#ref2\">(2)</a></span>. The body is a saucer shaped &#39;bell&#39;, which is colourless except for four obvious violet gonads visible in the centre of the disc&nbsp;<span style=\"font-family:inherit; font-size:0.714em\"><a href=\"http://www.arkive.org/common-jellyfish/aurelia-aurita/#ref2\">(2)</a></span>. The outer edges are fringed with many small tentacles, and four stocky &#39;arms&#39; surround the mouth&nbsp;<span style=\"font-family:inherit; font-size:0.714em\"><a href=\"http://www.arkive.org/common-jellyfish/aurelia-aurita/#ref2\">(2)</a></span>.</p>\r\n</div>\r\n', '537Jellyfish.jpg', NULL, 'http://www.ucarecdn.com/02a86846-d869-441d-bc5f-c0c552db87f5/-/crop/874x579/126,57/-/resize/650x430/', '2014-08-24 04:43:14', '2014-08-31 12:00:00', '', '0000-00-00 00:00:00', 300.00, 2, 1, 0, 0, 0, 0, 0, 2, 2, 1, 67, 0, 0, '0', 0, '', ''),
