INSERT INTO `reference_data_dictionary` (`DD Field`, `description`, `details`, `DD_column_order`) VALUES
('dict_id', 'Unique Record ID - Unused for now', '', 1),
('table_alias', 'Unique Name - Specifically Identifying this usage of the database table', 'This is CRITICAL !\r\n\r\nThis is the UNIQUE Identifier of a Table in the data dictionary (not the actual database name)\r\n\r\ndatabase tables often will have several entries in the DD - depending on where they are to be displayed in the system, and depending on how they are displayed.  \r\n\r\nexample:  the project database table\r\n\r\nthis will have several entries in the DD - so describe how projects are displayed on the\r\nHOME PAGE\r\nMyAccount Page (my projects)\r\nMyProjects Page\r\nProject Profile page', 2),
('database_table_name', 'the real MySQL table name ', 'Each table is represented, but some tables can be (and will be) represented more than once - since they will be used in different ways, and different places, in the App.', 3),
('table_type', 'Critical field- Specific type:  User, Project, Child, CrossRef, Transaction (etc', 'While the DD initialization code will try to assign the table_type based on the table name, this field (and not the table name) will tell the GP code exactly how to handle the table.  For instance - if (in a unique implementation of GP) there is a table named \"members\" ... we would assign the table_type=User ... and the GPC will know that this table is the official User table.\r\n\r\n1.  Table_type= user\r\n----------------------------\r\nsignifies a User table.   \r\n+ this is a parent table. A core, main type of table in the system\r\n+ there can be more than 1 user table defined. \r\n+ But other user tables are \"companion\" tables - fields/data displayed in extra tabs on screens.\r\nNOTE-CHANGE--> The MAIN user table will have table_type=user   and table_owner=NULL (or main)\r\nNOTE-CHANGE--> Any companion user tables will have table_type=user   and table_owner=user\r\n\r\n2.  Table_type= project\r\n----------------------------\r\nsignifies a Project (or product, or script) table\r\n+ this is a parent table. A core, main type of table in the system\r\n+ there can be more than 1 project table defined. \r\n+ But other project tables are \"companion\" tables - fields/data displayed in extra tabs on screens.\r\nNOTE-CHANGE--> The MAIN project table will have table_type=project   and table_owner=NULL (or main)\r\nNOTE-CHANGE--> Any companion user tables will have table_type=project   and table_owner=project\r\n\r\n\r\n\r\n3.  Table_type= child\r\n----------------------------\r\nsignifies a table whose records are related by a keyfield to a Parent table (table_owner)\r\n+ table_owner - field denotes the table with the parent relationship\r\nNOTE--> parent_key - field (MISSING) - denotes the key field common to both parent and child table.\r\n\r\n\r\n4.  Table_type= crossref\r\n----------------------------\r\nsignifies an independent table, typically of 1-1 \"code definitions\"\r\n(ie State Code, State ...  project_category_code,  project_category_name, project_category_descript, )\r\n+ these table are most often used in \"dropdown\" fields for input forms for other tables  (the chosen code gets inserted into the other table)\r\nmost often uses the fields validation_type=Dropdown\r\n\r\n\r\n5.  Table_type= transaction\r\n----------------------------\r\nthis is a special kind of table, its purpose is as it sounds - to log \"transaction\" activity between users and projects\r\n+ this table operates as a child table - but its parent is both the MAIN user table or the MAIN project table.  (see #1 and #2)\r\n+ at times, the transactions will be displayed as a relation (and filter) to the parent-user who \'created\' the transacton.\r\n+ other times, the transactions will be displayed as a relation to the parent-project that the transactiion was with.\r\n+ other times, the transactions will be displayed as a relation to the parent-user and the projecy-owner-userID\r\n(the above probably needs more clarification)\r\n\r\nNOTE-CHANGE--> parent_key  (new field)- should contain TWO keyfields (inside the transction table) denoting the userID field - comma the projectID field\r\nif blank then the system assumes  User_ID, Project_ID\r\nthis needs 2 key fields since the transaction table can act as a child to either the user table or project table\r\n\r\n\r\n5.  Table_type= NEW child\r\n----------------------------\r\nTBD - there will be a new file type defined.\r\n\r\n', 4),
('parent_table', 'For child tables (and similar) this describes the \"parent\" table it is related t', '', 5),
('parent_key', '(for a child table, others) - the key that is the parent-key', 'the key field of the field in the parent file that will be used for the database relationship with the current file  (usually userID, uid, or projectID etc).\r\n\r\n\r\nparent_key  (new field)- should contain TWO keyfields (inside the transction table) denoting the userID field - comma the projectID field\r\nif blank then the system assumes  User_ID, Project_ID\r\nthis needs 2 key fields since the transaction table can act as a child to either the user table or project table\r\n\r\n', 6),
(' display_page', 'Page Name:  HOME, USERACCOUNT, USERPROFILE, PROJECTPROFILE, PROJECTMAINT ...', 'Internally, in GPC, each display page is defined by a specific keyword\r\nHOME, USERACCOUNT, USERPROFILE, PROJECTPROFILE, PROJECTMAINT ...\r\n\r\nthis field tells the GPC that the data is to appear on that page, or inside a tab on that page.', 7),
('tab_num', 'Tab number (order) this table\'s data appears a page.', 'Mostly relevant on Profile pages and on Maintenance pages- where \"tabs\" (subpages) are used.  If 0 then this data is not used in any tabs.\r\n\r\nThis can also indicate, in certain cases, the location of the data on a page that does not used tabs (Mainly HOME page) for now.', 8),
('tab_name  ', 'Text that appears on the Tab ', '', 9),
('visibility', '(Unused for now) ', 'But the parameter still should be parsed and stored in the master array.\r\nDescribes how/if the table will appear.  \r\ncertain times the table will be only visible to certain users or under certain conditions', 10),
('user_type', 'Specifies the User Type allowed to view the table in the App', 'User_type will refer to a code in the user_type table ... \r\n\r\nand the user_type associated with the table will be the minimum \"level\" of user_type required in order for a user to view the table in the app\r\n\r\nThis is not the same as User Role, or User Privileges (though they may be inter-related)\r\n\r\nUSER_TYPE \r\nrefers to the \"kind\" of user logged into the system\r\n(if enabled in the app-configuration)\r\n\r\nExamples\r\nA site may have user types\r\n\r\nEntrepreneur\r\nInvestor\r\nTechnical Developer\r\nMarketer\r\nAdvisor\r\nEducator\r\nService Provider\r\nAdvertiser\r\n\r\nEach of these will have certain privileges etc\r\n\r\nbut we can specify, for each table, which user types can view the table.\r\n\r\n\r\n\r\n\r\n', 11),
('privilege_level', '(Unused for now) - References the user_privileges cross-reference table', 'This represents the minimum privilege level a user must have in order for this table to be displayed  (otherwise it is skipped in profile pages / tabs)', 12),
('list_views', 'List, XList, Card, If nonblank - table is displayed using the List Widget', 'IF list_view<>NULL\r\n\r\nthen GPC treats and displays the table as a List  (ie displays mutiple records)\r\nlist_view field then contains the allowed \"styles\" of lists  for this table\r\nand the UI allows the user to switch/select the different styles by clicking an icon\r\n\r\nStyles are\r\n+ List \r\nstandard list-widget - one line of text data per record\r\n+ XList\r\nan extended list - more than one line per record, and can include a very small thumbnail/icon image\r\n+ Card\r\nthe \"card view\"  (like on the home page)\r\n\r\nANN ASTERIX in front, specifies that this style is the default List-View\r\n\r\n*** we may later define other styles ... List2, List3 , Card2, Card3 ...\r\n\r\n+ \"Check\" in front of the style type indicates that mutiple selections are possible (checkmarks) \r\nCheckList, CheckXList, CheckCard\r\n\r\nTBD - we need to further specify the allowed functions for \"checked\" records\r\n\r\nNOTE - tables that are displayed with a checklist style MUST already have a field \"checkmark\" in its structure and in the FD\r\n', 13),
('list_filter', 'the field that is filtered for the list-view   ', 'Example:\r\nlist_filter=\"user_id\"', 14),
('list_sort', 'sort expression for list-view', 'a comma delimited field, with the fields to sort the list by.  * in front of one denotes a reverse sort.\r\nif multiple sort fields, then the UI allows the user to switch/select the sort field to each of the different fields.', 15),
('desc', 'Notes for the field in DD', '', 16),
('created', 'Creation/Update date of the record in DD', 'Very relevant and important, since this will indicate whether the record was updated by the customizer (sysadmin user) or created by the system DDICT generator.', 17),
('dropdown_fields', 'Will be depreciated - Read Details', 'If this record (table_name) is to describe how the table will be used as a dropdown list, for form input, then there will be a set of fields in FD for this table  (related by table_name)\r\n\r\n\r\n\r\nOLD\r\nThis should be a Unique function name that would be used by fields in the FD - to invoke a popup list of fields in this table.\r\n\r\nNOTE->  this field might be unnecessary.  there are more efficient ways of accomplishing this.\r\n\r\nif a field in the FD needs to reference ANY table for a dropdown display - then it really only has to reference the generic_table_name\r\n\r\nNOTE->I think instead this field should be DropdownFields.   A field containing a comma delimited list of the fields that should be displayed IF the table is referenced in a dropdown request.\r\n', 18),
(' list_fields  ', 'Will be depreciated - Read Details', 'This field/parameter will be unnecessary.  (but GPC must process correctly now)\r\n\r\nif this record (table_name) is a list ... then there will be a set of associated fields in FD that will indicate which fields will be used in the list display (and the field order)\r\n\r\n\r\n\r\nOLD\r\na comma delimited field, with the fields to be displayed in the list_view\r\nif blank, then the GPC will use the first nn fields in the FD (with visibility>0)  that are able to be displayed in the widget\r\n', 19);
INSERT INTO `reference_field_dictionary` (`FD Field`, `description`, `details`, `FD_column_order`) VALUES
('field_def_id', 'Unique Record ID - Unused for now', '', 1),
('table_alias  ', 'parent record in DD (table_alias) that this field is associated with.', 'The DD is parent to FD.\r\ntable_alias is the key field that relates the tables.\r\n\r\nthis field (and others like it) are fields associated with the table_name (table) entry in DD - and its database_table_name\r\n\r\nNote - in some cases there will seem to be lots of duplicate fields but there are no unnecessary redundencies.\r\n\r\none table_name may use a database table just for a brief list (thus only needs a few fields in the FD)\r\nanother table_name for the same database table may use all the fields (in FD)', 2),
('generic_field_name  ', 'field name as it appears in the database table', 'for reference, and also for the GPC to use when constructing SQL queries and loading field values.', 3),
('generic_field_order ', '(Unused for now) raw field order in the database for this field', '', 4),
('display_field_order ', 'order # where this field appears', 'relevant in display/forms, and lists ...', 5),
('field_identifier', 'specific keyword/code for what kind of field this is and how GPC will format it.', '----------------  -------------------\r\nfield_identifier  Action/Meaning\r\n----------------  -------------------\r\nKEYFIELD    primary keyfield\r\nKEYFIELD-1    primary keyfield (used with a secondary field)\r\nKEYFIELD-2    secondary keyfield (to be combined with primary)\r\nBlank/Null    not a keyfield, no special handling\r\n\r\n----------------  -------------------\r\nformat_length    Action/Meaning\r\n----------------  -------------------\r\nblank/null    field\'s native length  (character width)\r\n##      character length (character width) of the field - if char/varchar, numeric\r\n##, ##      if format_type = text, richtext etc ...  then this is the width, height of the box\r\n##, ##      if format_type = image, profileimage etc ...  then this is the width, height of the box\r\n##, ##      if format_type = videovideo...  then this is the width, height of the box\r\n\r\n\r\n----------------  -------------------\r\nformat_type    Action/Meaning\r\n----------------  -------------------\r\nphonenumber    formatted and validated as a phone number\r\nemail      formatted and validated as an email address\r\nnumber      forces the field to be formatted as a number  (will add more later)\r\ntext      forces the field to be formatted as a text (will add more later)\r\nzip      forces the field to be formatted as a zipcode\r\nzip+4      forces the field to be formatted as a zip+4 code\r\ncountry      dropdown for country codes  (don\'t implement yet)\r\nstate      dropdown for state codes  (don\'t implement yet)\r\n\r\nrichtext    forces CKedit (rich text editor)\r\nyesno      formats a boolean (OR char field) as a Y/N toggle\r\ntruefalse    formats a boolean (OR char field) as a T/F toggle\r\ncheckbox    formats a boolean (OR char field) as a checkbox\r\nicontoggle    TBD formats a boolean with an \"on\" icon or \"off\" icon toggle\r\n\r\nstarschoice    allows choice of stars 1-n (max as per format length)\r\niconschoice    allows choice of \"icons\"  1-n (max as per format length)  TBD\r\n\r\nusername    field is treated as a special username\r\nuserID      field is treated as a special UserID\r\npassword    field is treated as a password (hidden)\r\n\r\nprofileimage    a very specific directive for the format and location\r\n      of a profile image/photo.  very special case. tdb\r\nprofileimage    a very specific directive for the format and location\r\n      of a project image/photo.  very special case. tdb\r\nvideoimage    this is an image/thumbnail associated with a video (URL)\r\nvideovideo    video URL (display using a flash/html5 player)\r\n\r\ndropdown    this is a dropdoown field  (a separate spec)\r\n\r\ncurrency    format as $ xxx,xxx.xx  US currency (with format_length)\r\ndateMMYY    date format  MM/YY\r\ndateMMYYYY    date format  MM/YYYY\r\ndateMMDD    date format  MM/DD\r\ndateMMDDYYYY    date format  MM/DD/YYYY\r\n\r\ndatepickerMMYY    datepicker widget with date format  MM/YY\r\ndatepickerMMYYYY  datepicker widget with format  MM/YYYY\r\ndatepickerMMDD    datepicker widget with format  MM/DD\r\ndatepickerMMDDYYYY  datepicker widget with format  MM/DD/YYYY\r\n\r\nnumberslider    TBD  (I need to define min-max)\r\ntoggle      TBD  (I need to define) - but Y/N  slider/toggle\r\nnumberchooser    TBD  (up/down arrows choose the number)\r\n\r\ntimestamp    timestamp (time only)\r\ndatetimestamp    date+timestamp\r\n\r\nchoicesRadio    TBD radio buttons of specific choices\r\nchoicesXXXXX    TBD choices of specific choices - with special formatting.\r\n\r\n\r\nblank/null    field\'s native type, length', 7),
('format_type', 'The display formatting of the field', '\r\n----------------  -------------------\r\nformat_type    Action/Meaning\r\n----------------  -------------------\r\nphonenumber    formatted and validated as a phone number\r\nemail      formatted and validated as an email address\r\nnumber      forces the field to be formatted as a number  (will add more later)\r\ntext      forces the field to be formatted as a text (will add more later)\r\nzip      forces the field to be formatted as a zipcode\r\nzip+4      forces the field to be formatted as a zip+4 code\r\ncountry      dropdown for country codes  (don\'t implement yet)\r\nstate      dropdown for state codes  (don\'t implement yet)\r\n\r\nrichtext    forces CKedit (rich text editor)\r\nyesno      formats a boolean (OR char field) as a Y/N toggle\r\ntruefalse    formats a boolean (OR char field) as a T/F toggle\r\ncheckbox    formats a boolean (OR char field) as a checkbox\r\nicontoggle    TBD formats a boolean with an \"on\" icon or \"off\" icon toggle\r\n\r\nstarschoice    allows choice of stars 1-n (max as per format length)\r\niconschoice    allows choice of \"icons\"  1-n (max as per format length)  TBD\r\n\r\nusername    field is treated as a special username\r\nuserID      field is treated as a special UserID\r\npassword    field is treated as a password (hidden)\r\n\r\nprofileimage    a very specific directive for the format and location\r\n      of a profile image/photo.  very special case. tdb\r\nprofileimage    a very specific directive for the format and location\r\n      of a project image/photo.  very special case. tdb\r\nvideoimage    this is an image/thumbnail associated with a video (URL)\r\nvideovideo    video URL (display using a flash/html5 player)\r\n\r\ndropdown    this is a dropdoown field  (a separate spec)\r\n\r\ncurrency    format as $ xxx,xxx.xx  US currency (with format_length)\r\ndateMMYY    date format  MM/YY\r\ndateMMYYYY    date format  MM/YYYY\r\ndateMMDD    date format  MM/DD\r\ndateMMDDYYYY    date format  MM/DD/YYYY\r\n\r\ndatepickerMMYY    datepicker widget with date format  MM/YY\r\ndatepickerMMYYYY  datepicker widget with format  MM/YYYY\r\ndatepickerMMDD    datepicker widget with format  MM/DD\r\ndatepickerMMDDYYYY  datepicker widget with format  MM/DD/YYYY\r\n\r\nnumberslider    TBD  (I need to define min-max)\r\ntoggle      TBD  (I need to define) - but Y/N  slider/toggle\r\nnumberchooser    TBD  (up/down arrows choose the number)\r\n\r\ntimestamp    timestamp (time only)\r\ndatetimestamp    date+timestamp\r\n\r\nchoicesRadio    TBD radio buttons of specific choices\r\nchoicesXXXXX    TBD choices of specific choices - with special formatting.\r\n\r\n\r\nblank/null    field\'s native type, length\r\n\r\n\r\n----------------  -------------------\r\nfield_identifier  Action/Meaning\r\n----------------  -------------------\r\nKEYFIELD    primary keyfield\r\nKEYFIELD-1    primary keyfield (used with a secondary field)\r\nKEYFIELD-2    secondary keyfield (to be combined with primary)\r\nBlank/Null    not a keyfield, no special handling\r\n\r\n----------------  -------------------\r\nformat_length    Action/Meaning\r\n----------------  -------------------\r\nblank/null    field\'s native length  (character width)\r\n##      character length (character width) of the field - if char/varchar, numeric\r\n##, ##      if format_type = text, richtext etc ...  then this is the width, height of the box\r\n##, ##      if format_type = image, profileimage etc ...  then this is the width, height of the box\r\n##, ##      if format_type = videovideo...  then this is the width, height of the box\r\n\r\n', 6),
('field_label_name  ', 'Text label for the field', 'Appears next to the field when displayed as a form, or used as a column heading when displayed as a list', 9),
('visibility  ', '(Unused for now) ', 'But the parameter still should be parsed and stored in the master array.\r\nDescribes how/if the field will appear.  \r\n\r\ncertain times the field will be only visible to certain users or under certain conditions', 10),
('privilege_level  ', '(Unused for now) - References the user_privileges cross-reference table', 'This represents the minimum privilege level a user must have in order for this field to be displayed  (otherwise it is skipped)', 11),
('sub_tab_num  ', '(Unused for now) ', '', 12),
('editable  ', 'T/F - is the field editable or read-only (display only)', 'specifies if the field is read only or not.  not sure this is needed in the future\r\n\r\nvisibility/privilege levels handle this better,\r\nwe will keep it for now, but if it is being used, it will be replaced by visibility/priveleges', 13),
('required  ', 'specifies whether the user is required to enter a value for this field.', '', 14),
('error_message  ', 'the text of any error message to pop up, upon unsuccessful field validation', 'Field validation is done by the GPC based on the FD format_type for this field.', 15),
('help_message  ', 'the text of any contextual help message to pop up', '', 16),
('dropdownFN  ', 'specifies the table/data to dropdown to accept entries for this field', 'See spec.  \r\nUsually specifies the table_name (and associated parameters in DD) to POP-UP, when format_type=DROWPDOWN\r\n\r\nif the field is being displayed as part of a list view - then dropdown is ignored\r\n\r\nIn other words - \r\nif format__type=Dropdown, then this field is to be displayed on the page as a \"dropdown\" field of choices - and the data, fields, etc are specified by the table_name referenced here  (a record in the DD)', 17),
('format_length', 'length of the field', '----------------  -------------------\r\nformat_length    Action/Meaning\r\n----------------  -------------------\r\nblank/null    field\'s native length  (character width)\r\n##      character length (character width) of the field - if char/varchar, numeric\r\n##, ##      if format_type = text, richtext etc ...  then this is the width, height of the box\r\n##, ##      if format_type = image, profileimage etc ...  then this is the width, height of the box\r\n##, ##      if format_type = videovideo...  then this is the width, height of the box\r\n\r\n----------------  -------------------\r\nfield_identifier  Action/Meaning\r\n----------------  -------------------\r\nKEYFIELD    primary keyfield\r\nKEYFIELD-1    primary keyfield (used with a secondary field)\r\nKEYFIELD-2    secondary keyfield (to be combined with primary)\r\nBlank/Null    not a keyfield, no special handling\r\n\r\n', 8);
